from sympy import factorint
def a(n):
    if n == 1: return 1
    factors = factorint(n)
    phi, w = 1, len(factors)
    for p, e in factors.items():
        phi *= (p - 1) * p**(e - 1)
    return n**((1 << (w-1)) - 1) * phi
